      <div className={ name }>
        <p data-testid="planet-name">{name}</p>
        <img
          src={ image }
          alt={ `Planeta ${name}` }
          id={ name }
        />
        <img
          src={ luaImg }
          alt="Lua"
          id="Lua"
        />
      </div>
    );
  }
}

